import React from 'react'
import styles from './index.less'

export default class Footer extends React.Component {
  render() {
    return (
      <>
        <footer className="footer-wrap">
          <div className="w">
             <ul className="company-info">
               <li>
                 <img src="/static/images/qr.png" alt=""/>
               </li>
               <li>

               </li>
             </ul>
          </div>
        </footer>
        <style jsx>
          {
            styles
          }
        </style>
      </>
    )
  }
}
